import React from 'react';
import { Link } from 'react-router-dom';

const BarraNavegacao = () => {
    return (
        <nav>
            <h1>Caça-Preço</h1>
            <ul>
                <li>
                    <Link to="/">Início</Link>
                </li>
                <li>
                    <Link to="/produtos">Produtos</Link>
                </li>
                <li>
                    <Link to="/login">Login</Link>
                </li>
                <li>
                    <Link to="/cadastro">Cadastrar</Link>
                </li>
            </ul>
        </nav>
    );
};

export default BarraNavegacao;
